import React from 'react';
import NavBar from './NavBar';
import NavMain from './NavMain';
import "./NavMain.css";


const Header = () => {
    return (
        <div style={{height:"700px"}} class="setTheBg">
            <NavBar/>
            <NavMain/>
        </div>
    );
};

export default Header;
